import * as React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Grid } from '@mui/material';



export const BasicCard = () => {
    return (
        <Card sx={{ minWidth: 275 }}>
            <CardContent>
                <Grid item>

                    <Typography variant="h5">First Team</Typography>

                </Grid>
                <Grid item>

                    <img style={{ width: 85 }} src={require("../../public/img/vs.png")}/>
                </Grid>
                <Grid item>
                <Typography variant="h5">Second Team</Typography>
                </Grid>
            </CardContent>
            <CardActions>

                <Grid container justify="center" >
                    <Button item variant="contained" color="primary">Show Details</Button>
                    <Button item variant="contained" color="primary">{new Date().toString()}</Button>

                </Grid>

            </CardActions>
        </Card>
    );
}
